export default function Product(prop) {
    const products = [
        { 
          product_name: "Product 1",
          product_img1: "images/product-1-1.jpg",
          product_img2: "images/product-1-2.jpg",
          product_price: "$299.99"
        },
        { 
          product_name: "Product 2",
          product_img1: "images/product-1-1.jpg",
          product_img2: "images/product-1-2.jpg",
          product_price: "$299.99"
        },
        { 
          product_name: "Product 3",
          product_img1: "images/product-1-1.jpg",
          product_img2: "images/product-1-2.jpg",
          product_price: "$299.99"
        },
        { 
          product_name: "Product 4",
          product_img1: "images/product-1-1.jpg",
          product_img2: "images/product-1-2.jpg",
          product_price: "$299.99"
        }
      ];
      const getAnimalsContent = product => {
        let content = [];
        for (let i = 0; i < product.length; i++) {
          const item = product[i];
          content.push(
            <div className='col-lg-3'>
              <div className="product product-10 text-center">
                <figure className="product-media">
                  <a href="product.html">
                    <img src={item.product_img1} alt={item.product_name} className="product-image" />
                    <img src={item.product_img2} alt={item.product_name} className="product-image-hover" />
                  </a>
                </figure>
                <div className="product-body">
                  <div className="product-action">
                    <a href="#" className="btn-cart"><span>add to cart</span></a>
                    <a href="#" className="btn-product-icon btn-wishlist"><span>Add to Wishlist</span></a>
                  </div>
                  <div className="product-intro">
                    <h3 className="product-title">
                      <a href="product.html">{item.product_name}</a>
                    </h3>
                    <div className="product-price">{item.product_price}</div>
                  </div>
                  <div className="product-detail">
                    <div className="ratings-container">
                      <div className="ratings">
                        <div className="ratings-val"></div>
                      </div>
                      <span className="ratings-text">( 6 Reviews )</span>
                    </div>             
                  </div>
                </div>
              </div>
            </div>
          );
        }
        return content;
    };
    return(
        <div className={prop.parantClass}>
            {getAnimalsContent(products)}
        </div>

    );
}
